description:
The Bible isn't just God's ideas. It contains His actual words.

The Bible is God's book. He gave it by inspiration. The words of scripture are God's words. But not only did God give His words to man, He also promised to preserve them... for specific reasons. They are shown to us in the Bible. We believe that we have the perfectly preserved words of God in our 1611 King James Bible, also called the Authorized Version or KJV.




